import React from 'react';
import './SpecialPages.css';

export default function AudiobooksPage() {
  const sampleBooks = [
    { title: 'Mindfulness Mastery', author: 'Dr. Sarah Wilson', duration: '5h 42m' },
    { title: 'Startup Success', author: 'Mark Cuban', duration: '6h 15m' },
    { title: 'Fitness Fundamentals', author: 'Jillian Michaels', duration: '4h 30m' },
  ];

  return (
    <div className="special-page-container">
      <h1 className="page-title">
        <i className="material-icons">library_music</i>
        Vybes Audiobooks
      </h1>
      <div className="audiobooks-grid">
        {sampleBooks.map((book, index) => (
          <div key={index} className="audiobook-card">
            <div className="cover-art">
              <i className="material-icons">headphones</i>
            </div>
            <div className="book-info">
              <h3>{book.title}</h3>
              <p>{book.author}</p>
              <p className="duration">{book.duration}</p>
            </div>
            <button className="play-button">
              <i className="material-icons">play_arrow</i>
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}
